VideoContract.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract VideoBlockchainTracker {
    struct Video {
        string videoHash;
        string caption;
        string tag;
        address uploader;
        uint256 timestamp;
    }

    mapping(address => Video[]) public videos;

    event VideoUploaded(
        address indexed uploader,
        string videoHash,
        string caption,
        string tag,
        uint256 timestamp
    );

    function uploadVideo(string memory _videoHash, string memory _caption, string memory _tag) public {
        Video memory newVideo = Video({
            videoHash: _videoHash,
            caption: _caption,
            tag: _tag,
            uploader: msg.sender,
            timestamp: block.timestamp
        });

        videos[msg.sender].push(newVideo);

        emit VideoUploaded(msg.sender, _videoHash, _caption, _tag, block.timestamp);
    }

    function getVideosByUploader(address _uploader) public view returns (Video[] memory) {
        return videos[_uploader];
    }
}

